import { Component } from 'react';
import Item from '../ItemModel';
import styles from './Items.module.scss';
export class Items extends Component {
  render() {
    return (
      <main className={styles.item}>
        {this.props.items.map((el) => (
          <Item item={el} />
        ))}
      </main>
    );
  }
}

export default Items;
